import React from 'react';

import './home.css';

import { HomeIndexSection } from './home_section/main';
import { HomeFooterSection } from './home_section/footer';

const GlowHome = () => {
  return <div className='homePageContainer'>
    <div className='homePage'>
      <HomeIndexSection />
      <HomeFooterSection />
    </div>
  </div>
};

export { GlowHome };
